from math import inf 
def maximumStrongPairXor1(nums):
    nums.sort()
    maxStrongPairXor = -inf
    for i in range(len(nums)):
        for j in range(i, len(nums)):
            x, y = nums[i], nums[j]
            if abs(x - y) <= min(x, y):
                binary_x = bin(x)[2:]
                binary_y = bin(y)[2:]
                max_len = max(len(binary_x), len(binary_y))
                binary_x = binary_x.zfill(max_len)
                binary_y = binary_y.zfill(max_len)

                result_binary = ''.join(['1' if bit_x != bit_y else '0' for bit_x, bit_y in zip(binary_x, binary_y)])
                result_decimal = int(result_binary, 2)
                maxStrongPairXor = max(maxStrongPairXor, result_decimal)


    return maxStrongPairXor

