class TrieNode:
    def __init__(self):
        self.children = {}
        
class Trie:
    def __init__(self):
        self.root = TrieNode()
    
    def insert(self, num):
        node = self.root
        for i in range(31, -1, -1):  
            bit = (num >> i) & 1
            if bit not in node.children:
                node.children[bit] = TrieNode()
            node = node.children[bit]
            
    def findMaxXOR(self, num):
        node = self.root
        res = 0
        for i in range(31, -1, -1):
            bit = (num >> i) & 1
            complement = 1 - bit
            if complement in node.children:
                res |= (1 << i)
                node = node.children[complement]
            else:
                node = node.children[bit]
        return res


def maximumStrongPairXor(nums):
    trie = Trie()
    maxStrongPairXor = 0

    for num in nums:
        trie.insert(num)
        maxStrongPairXor = max(maxStrongPairXor, trie.findMaxXOR(num))

    return maxStrongPairXor

